import React, {Component} from 'react';
class App extends Component{
  render(){
    return(
      <div>
        <p>Hello React</p>
        <Header/>
      </div>
    );
  }
}

class Header extends Component{
  render(){
    return(
      <Header>header</Header>
    );
  }
}

export default App;
